import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import Header from './AppHeader';

class App extends Component {

  render() {

    return <div>
      <AppHeader />
      <h1>Hello, world!</h1>
    </div>
  }
}

ReactDOM.render(<App />, document.getElementById('root'));
